  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Crescent Lake
  National Wildlife Refuge outlines Refuge accomplishments from September through
  December of 1943. The report begins by summarizing the weather conditions and water
  conditions during this period. Wildlife- including migratory birds, upland game
  birds, big game animals, furbearers, predators, and rodents- is also covered. The
  Refuge development and maintenance section discusses physical developments and wildfires.
  Resource management is outlined; topics include grazing and haying. The public relations
  section of the report describes Refuge visitors. N-R forms and photographs are attached.\",\n\t\"owner_org\":
